import React from 'react';
import Math from './Math';
import './App.css'

class App extends React.Component{
	constructor(){
		super()
		this.state = {
			math:Math
		}
	}



	render(){
		var j
		var math = [];
		for(j=0;j<11;j++){
			let first = j;
			let second = j;
			var third = first * second;
			return (
				<div>
					first{first},
					second{second},
					third{third}
				</div>
			)
			math.push(third);
			console.log(math)
		}

	}

}

export default App;
